INSERT INTO `cms_article` VALUES ('1bfc5c49ee81494dbb86e92f9a1b799d', '5', '医生说：解除脱发危机，治疗需早需耐心！', '/static/hospitalCoustom/newsdetail.html', '', '/userfiles/1/_thumbs/images/app/userApp/qietu/formula1.png', '', '脱发在我国并不是稀罕事，尤其是男性型脱发，男性型脱发并不仅仅针对男性，女性也会患男性型脱发，基本上每5个成年男性中就有1个，而女性则20人中有1人。但是，相对于严峻的疾病现状，公众对脱发的认知却严重不足。面对庞大的脱发群体，北京大学人民医院皮肤科主任医师张建中表示：脱发是渐进的一个过程，治疗需早需耐心。', '1000', null, '4', ',null,', '', '', '1', '2017-11-23 11:11:21', '1', '2017-12-15 13:07:42', null, '1');
INSERT INTO `cms_article` VALUES ('47fdfedea4b9405e810dcdb3b7517266', '5', '如何让冠心病人平安过冬？', '/static/hospitalCoustom/newsdetail.html', '', '/userfiles/1/_thumbs/images/app/userApp/qietu/formula3.png', '', '随着天气逐渐寒冷，人体血管收缩，代谢增高，冬天作为冠心病高发季节，冠心病患者发生急性心肌梗塞的人数逐渐增加。上海远大心胸医院张大东院长表示，天气寒冷，特别是老年人心肺功能较弱，心排血量降低，冠状动脉血流量减少，遇到寒冷刺激，冠状动脉发生痉挛，使本来就狭窄的冠状动脉血流量减少，甚至瘀阻不通，心肌缺血缺氧而引发心绞痛或心肌梗死。患有心血管等慢性疾病的老人要注意以下方面，让心脏平安过冬。', '996', null, '0', ',null,', '', '', '1', '2017-12-04 17:46:12', '1', '2017-12-15 13:09:12', null, '1');
INSERT INTO `cms_article` VALUES ('5b5cb6ed92a0433bb5b50bd952deb25b', '4', '养胃的方法，中医养胃有偏方', '/static/hospitalCoustom/newsdetail.html', '', '/userfiles/1/_thumbs/images/app/userApp/qietu/tesezhongyi1.png', '', '冬季天气寒冷，设想一下这样的景象：外面下着雪，跟家人或朋友，大家围在一起，吃着热气腾腾的火锅，是多么惬意的事啊！确实天冷大家都喜欢吃点热乎的，但一定要提醒的是：吃热的，不宜吃烫的！', '998', null, '0', ',null,', '', '', '1', '2017-12-07 19:14:00', '1', '2017-12-15 13:05:56', null, '1');
INSERT INTO `cms_article` VALUES ('6c521fcfe1d745fda773886543defcd7', '8', '公告通知', '/static/hospitalCoustom/newsdetail.html', '', '', '', '2017年上海中医药大学“中医经典与现代化――经方学习与应用”上海市研究生暑期学校招生简章', '0', null, '0', ',null,', '', '', '1', '2017-12-22 09:32:29', '1', '2017-12-22 09:32:29', null, '1');
INSERT INTO `cms_article` VALUES ('77fd8a80a49047c79df372a2d95845df', '5', '防病治病', '/static/hospitalCoustom/newsdetail.html', '', '/userfiles/1/_thumbs/images/app/userApp/qietu/formula4.png', '', '防病治病摘要', '995', null, '0', ',null,', '', '', '1', '2017-12-15 13:09:44', '1', '2017-12-15 13:09:53', null, '1');
INSERT INTO `cms_article` VALUES ('8c03a9d4fd854d19b08776e7f8f821f6', '4', '看看你是否属于“湿重”？', '/static/hospitalCoustom/newsdetail.html', '', '/userfiles/1/_thumbs/images/app/userApp/qietu/tesezhongyi2.png', '', '中医致病认为有外邪和内虚二种因素，外邪主要指风寒暑湿燥火，被中医成为“六淫”。湿是其中之一，也是最难去除的一种。', '999', null, '0', ',null,', '', '', '1', '2017-12-07 19:13:12', '1', '2017-12-15 13:05:44', null, '1');
INSERT INTO `cms_article` VALUES ('8f4f8c2801404074b08d41e9ff2d4a65', '8', '公告通知', '/static/hospitalCoustom/newsdetail.html', '', '', '哈哈', '2015年上海市“中西医结合临床在中医全球化背景下的思维启迪”研究生暑期学校招生简章', '0', '2017-12-21 00:00:00', '0', ',null,', '', '', '1', '2017-12-21 15:59:22', '1', '2017-12-22 09:31:35', null, '1');
INSERT INTO `cms_article` VALUES ('acae3b31f71f4a06ab6b3e8c46a5b703', '5', '为什么糖尿病人多合并有高血压？糖尿病人高血压如何选', '/static/hospitalCoustom/newsdetail.html', '', '/userfiles/1/_thumbs/images/app/userApp/qietu/formula2.png', '', '由于有相似的发病因素，比如说长期高热量饮食，大量饮酒，肥胖少动等，糖尿病和高血压常常一起出现，相互并存。研究显示，55.9%的高血压患者合并糖尿病，而58%的糖尿病患者合并高血压。\r\n　　此外，如果糖尿病损害了肾脏，还会引起肾性高血压，高血压的比例将会进一步增加；如果到了糖尿病肾病尿毒症期，几乎百分之百的患者都会有高血压。', '997', null, '0', ',null,', '', '', '1', '2017-11-29 17:23:48', '1', '2017-12-15 13:08:57', null, '1');
INSERT INTO `cms_article` VALUES ('c522cafb890f42f7b7cc459ac1b83ff0', '9', '停诊通知', '/static/hospitalCoustom/notice.html', '', '', '', '各位用户，今天a医生由于家里有事，停诊一天，很抱歉大家！', '997', null, '0', ',null,', '', '', '1', '2017-11-29 17:25:16', '1', '2017-12-15 13:08:15', null, '0');
INSERT INTO `cms_article` VALUES ('cd016423d892434794bf2743ece3b23b', '3', '药物加手术治疗“帕金森病”！让恢复健康不再不可能！', '/static/hospitalCoustom/newsdetail.html', '', '/userfiles/1/_thumbs/images/app/userApp/qietu/home-7.png', '', '帕金森如今已经成为中老年人的高发疾病，帕金森症状给患者的身体健康造成很大的影响。有些患者不注意帕金森的治疗，认为帕金森症状只是年老了造成的身体机能退化，导致最后错过治疗的最佳时期，对于帕金森患者而言，要早日发现帕金森症状并且及时的进行治疗。', '995', null, '0', ',null,', '', '', '1', '2017-12-04 17:47:24', '1', '2017-12-15 13:03:28', null, '1');
INSERT INTO `cms_article` VALUES ('e7a0a02784f246f88e242ffffad39969', '3', '肺癌中医怎么治疗？', '/static/hospitalCoustom/newsdetail.html', '', '/userfiles/1/_thumbs/images/app/userApp/qietu/home-7.png', '', '肺癌是目前我国发病率和死亡率最高的恶性肿瘤，目前，我国每4例恶性肿瘤死亡者中就有1例是肺癌患者，由于肺癌早期症状轻微、多隐匿，不容易被早期发现。80%的肺癌患者在临床确诊时已经处于中晚期，失去了外科手术治疗机会。', '998', null, '0', ',null,', '', '', '1', '2017-11-29 17:21:45', '1', '2017-12-15 13:02:54', null, '1');
